import { Console } from 'console';
import React, { Component } from 'react';

class Practica09 extends Component {

  state = { nRandom: 0 }

  render() {
    let arr=["pepe","Maria","Isidoro","Rigoberto","Koko"];
    let arrG=[];
    let {nRandom} = this.state;
    function pepe(){
        let num;
        num = Math.trunc(Math.random()*arr.length);
        console.log(num);
        return num;
    }


    return (
      <div>
            <button onClick={()=>this.setState({nRandom: pepe()})}>Alumnos al azar</button>
            {arrG.push(arr.at(nRandom))}
            <p>Alumno {arr.at(nRandom)}</p>
            <p>Lista de alumnos</p>

      </div>
    )
  }
}
export default Practica09;
